import React, { useState } from 'react';

function Losowanie2() {
  const [numbers, setNumbers] = useState(new Set());

  const generateRandomNumber = () => {
    // Wygeneruj losową liczbę od 1 do 100
    const randomNumber = Math.floor(Math.random() * 100) + 1;
    
    let newNumbers = new Set(numbers);
    if (numbers.size === 3) {
      // Usuń pierwszy element tablicy i dodaj nową liczbę na końcu
      const firstNumber = Array.from(newNumbers)[0];
      newNumbers.delete(firstNumber);
    }
    newNumbers.add(randomNumber);
    setNumbers(newNumbers);
  }

  return (
    <div>
      <button onClick={generateRandomNumber}>Generuj losową liczbę</button>
      {Array.from(numbers).map((number, index) => (
        <div key={index}>{number}</div>
      ))}
    </div>
  );
}

export default Losowanie2;
